export interface Category {
    categoryId: number,
    name: string;
}


export const categories: Category[] = [
    {
        categoryId: 1,
        name: 'phone',
    },
    {
        categoryId: 2,
        name: 'laptop',
    },
    {
        categoryId: 3,
        name: 'TV',
    },
    {
        categoryId: 4,
        name: 'Sport',
    },
]
